HQ rare promo music video from a promo DVD. &quot;Reptilia&quot; is a song by indie rock band The Strokes, and the second single from their second album  Room on Fire. The single's B-side contains &quot;Modern Girls &amp; Old Fashion Men&quot;, where lead singer Julian Casablancas duets with Regina Spektor. The official release date was delayed slightly after Casablancas objected to the song being credited as &quot;The Strokes and Regina Spektor&quot;, claiming that it should read &quot;by Regina Spektor &amp; The Strokes&quot;.

The title &quot;Reptilia&quot; refers to the &quot;Reptilian complex&quot;, the central part of one's brain that handles basic emotions such as love and hate. The cover of the single features the artwork from the cabinet of the 1980 arcade game Centipede by Atari.

In October 2011, NME placed it at number 129 on its list &quot;150 Best Tracks of the Past 15 Years&quot;.Although it is not one of the band's highest charting singles since the song peaked art #19 on the Modern Rock Tracks chart, it is still one of the band's most popular singles.

The song features in the video games Guitar Hero III and Rock Band.

The music video for the song was their first that was not directed by Roman Coppola. Instead they chose Jake Scott to shoot the video, which features close shots of the band members' faces, hands and instruments while performing the song. At the end of the video, Julian Casablancas spits into the camera lens.

The Strokes are an American rock band from New York, consisting of Julian Casablancas (lead vocals), Nick Valensi (guitar, backing vocals), Albert Hammond, Jr. (guitar, backing vocals), Nikolai Fraiture (bass guitar) and Fabrizio Moretti (drums, percussion). 

Upon the release of their debut album Is This It in 2001, the group met much critical acclaim. Since then, the band has maintained a large fan base all over the world, most notably in the United States, the United Kingdom, Argentina, Canada, France, Brazil and Australia. A number of members have embarked on a variety of side projects, although a fourth album, entitled Angles, was released on March 22, 2011. They are one of the most prominent indie-rock bands to hail from the US at the dawn of the 21st century and helped start the garage rock revival movement. Is This It was ranked number 199 on Rolling Stone's 500 Greatest Albums of All Time.
